Sidak Penjual Obat Daftar G Tindak Lanjut adanya Laporan Warga yang Resah Berlokasi di Jalan I Gusti Ngurah Rai RT 06 RW 06 di bawah Kolong Jembatan

Kegiatan dihadiri :
- Polsek Metro Bekasi Barat
- MP Kec.Bekasi Barat
- Plh. Kasiepem Kel.Bintara
- Satpol PP Kec.Bekasi Barat
- Staf Pem Kec.Bekasi Barat
- Staf Pem Kel.Bintara
- pamor RW 06
- Ketua RW 06 Bintara

*III. Rangkaian Kegiatan dilaporkan sbb:*
1. Bersama tiga pilar melakukan sidak ke pedagang penjual obat yang di duga terlarang ( daftar G / kategori obat bius );
2. Hasil Sidak di temukan beberapa jenis obat Daftar G / kategori obat bius di lokasi;
3. 2 org penjual obat masih dalam pemeriksaan oleh bimaslpol Kel.Bintara;
4. Kegiatan sidak masih berlangsung.

